import React from 'react';
import { Route, Switch, useRouteMatch, Link } from 'react-router-dom';

import ClassManagement from './ClassManagement';
import StudentManagement from './StudentManagement';
import PaymentManagement from './PaymentManagement';
// 다른 컴포넌트들도 import

const Admin = () => {
  let { path, url } = useRouteMatch();

  return (
    <div>
      <h1>Admin 페이지</h1>
      <div className="admin-menu">
        <Link to={`${url}/class-management`}>클래스관리</Link>
        <Link to={`${url}/student-management`}>학생관리</Link>
        <Link to={`${url}/payment-management`}>결제관리</Link>
        {/* ... 다른 메뉴들 */}
      </div>
      
      <Switch>
        <Route exact path={path} component={Dashboard} />
        <Route path={`${path}/class-management`} component={ClassManagement} />
        <Route path={`${path}/student-management`} component={StudentManagement} />
        <Route path={`${path}/payment-management`} component={PaymentManagement} />
        {/* ... 다른 라우트들 */}
      </Switch>
    </div>
  );
};

export default Admin;
